"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Carb counting and your child&rsquo;s diet (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/carb-counting-and-your-childs-diet-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H5547178\">",
"      <span class=\"h1\">",
"       What is carb counting?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Carb counting is a type of meal planning that many people with diabetes (or &ldquo;diabetes mellitus&rdquo;) use. It is a way for people to figure out how many &ldquo;carbs&rdquo; they eat. &ldquo;Carbs&rdquo; is short for &ldquo;carbohydrates.&rdquo;",
"     </p>",
"     <p>",
"      Our body breaks down the food we eat into 3 main types of nutrients: carbohydrates, proteins, and fats. Carbohydrates are sugars and starches that come from food. The body uses carbohydrates for energy.",
"     </p>",
"     <p>",
"      People with diabetes need to watch how many carbs they eat, because carbs raise a person&rsquo;s blood sugar level.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5547193\">",
"      <span class=\"h1\">",
"       Which foods have carbs?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Foods with a lot of carbs include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Bread, pasta, rice, and cereal",
"       </li>",
"       <li>",
"        Fruits and starchy vegetables",
"       </li>",
"       <li>",
"        Milk and other dairy foods",
"       </li>",
"       <li>",
"        Foods with added sugar (such as many cookies and cakes)",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5547207\">",
"      <span class=\"h1\">",
"       How is carb counting helpful?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Carb counting helps you:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Choose the right amount of insulin to give your child before meals and snacks &ndash; The insulin dose depends on different factors, including what your child eats (especially the amount of carbohydrates) and how much he or she exercises.",
"       </li>",
"       <li>",
"        Plan your child&rsquo;s meals and snacks for the day &ndash; You can use carb counting to figure out how many carbs your child should eat at each meal and snack.",
"       </li>",
"       <li>",
"        Keep your child&rsquo;s blood sugar level under control &ndash; Spreading out the carbs your child eats over a whole day can help keep his or her blood sugar from getting too low or too high. This can help control your child&rsquo;s diabetes better and prevent medical problems that diabetes can cause.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5547222\">",
"      <span class=\"h1\">",
"       How do I count carbs?",
"      </span>",
"      &nbsp;&mdash;&nbsp;To count carbs, you need to look at the food&rsquo;s nutrition label (if it has a nutrition label). You will need to look at the:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        &ldquo;Total carbohydrate&rdquo; number &ndash; This tells you how many carbs are in 1 serving size of the food. If your child eats 1 serving, then the number of carbs your child eats will be the same as this number.",
"       </li>",
"       <li>",
"        &ldquo;Serving size&rdquo; &ndash; This tells you how much food is in 1 serving. If your child has 2 servings, the number of carbs will be 2 times the number of carbohydrates listed.",
"       </li>",
"       <li>",
"        &ldquo;Dietary fiber&rdquo; &ndash; Fiber is a carbohydrate that is not digested and so does not raise blood sugar. Foods with a lot of fiber can help control your child&rsquo;s blood sugar. If a food has more than 5 grams (g) of fiber, less insulin is needed for that food (",
"        <a class=\"graphic graphic_figure graphicRef76576 \" href=\"mobipreview.htm?0/2/40\">",
"         figure 1",
"        </a>",
"        ).",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If your child&rsquo;s food doesn&rsquo;t have a nutrition label, talk with your dietitian (food expert), diabetes nurse, or doctor. He or she can give you information about the usual serving sizes of different foods and the number of carbs in 1 serving size.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5547237\">",
"      <span class=\"h1\">",
"       How can I plan my child&rsquo;s meals?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your child&rsquo;s dietitian will tell you how many carbs your child should eat in 1 day. It will depend on your child&rsquo;s age, size, and how active he or she is.",
"     </p>",
"     <p>",
"      You can spread out the total number of carbs over your child&rsquo;s meals and snacks for the day. That way, your child can eat some carbs at each meal or snack. Writing down the number of carbs your child eats at each meal and snack can help you keep track of the total number.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5547252\">",
"      <span class=\"h1\">",
"       Does my child need special foods?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No. Your child can eat the same foods as your family. But, if possible, your family should eat a healthy diet with low-fat foods and lots of vegetables. It&rsquo;s best for your child to get carbs from fruits, vegetables, whole grains, and low-fat milk and dairy products. Whole grains are found in foods such as whole wheat bread, whole grain cereals, and brown rice.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5547267\">",
"      <span class=\"h1\">",
"       What if my child is a picky eater?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If your child is a picky eater, try to be creative. Ask your dietitian, doctor, or nurse for ideas for new snacks. If your child refuses to eat at meal or snack time, give him or her milk or juice instead.",
"     </p>",
"     <p>",
"      Your diabetes team can also tell you how to adjust the timing and amount of your child&rsquo;s insulin dose when his or her appetite changes.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5547284\">",
"      <span class=\"h1\">",
"       What if my child eats food without telling me?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If your child eats extra snacks, remind him or her that eating extra food can raise his or her blood sugar level and lead to serious problems. Your child should always let you know if he or she wants to eat extra food. That way, you can make sure he or she has the right amount of insulin.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5547299\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
