var content_f36_52_37701=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F82634&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F82634&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 657px\">",
"   <div class=\"ttl\">",
"    Recommended adult immunization schedule, by vaccine and age group* - United States, 2013",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 637px; height: 645px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <strong>",
"     NOTE:",
"    </strong>",
"    The recommendations above",
"    <strong>",
"     must",
"    </strong>",
"    be read along with the footnotes.",
"    <br/>",
"    The recommendations in this schedule were approved by the Centers for Disease Control and Prevention's (CDC) Advisory Committee on Immunization Practices (ACIP), the American Academy of Family Physicians (AAFP), the American College of Physicians (ACP), American College of Obstetricians and Gynecologists and American College of Nurse-Midwives (ACNM).",
"    <div class=\"footnotes\">",
"     *",
"     <strong>",
"      Additional information",
"     </strong>",
"     <br/>",
"     <ul>",
"      <li>",
"       These schedules indicate the recommended age groups and medical indications for which administration of currently licensed vaccines is commonly indicated for adults ages 19 years and older, as of January 1, 2013. For all vaccines being recommended on the Adult Immunization Schedule: a vaccine series does not need to be restarted, regardless of the time that has elapsed between doses. Licensed combination vaccines may be used whenever any components of the combination are indicated and when the vaccine's other components are not contraindicated.",
"      </li>",
"      <li>",
"       Additional guidance for the use of the vaccines described in this supplement is available at file://www.cdc.gov/vaccines/pubs/acip-list.htm.",
"      </li>",
"      <li>",
"       Information on vaccination recommendations when vaccination status is unknown and other general immunization information can be found in the General Recommendations on Immunization at file://www.cdc.gov/mmwr/preview/mmwrhtml/rr6002a1.htm.",
"      </li>",
"      <li>",
"       Information on travel vaccine requirements and recommendations (eg, for hepatitis A and B, meningococcal, and other vaccines) are available at file://wwwnc.cdc.gov/travel/page/vaccinations.htm.",
"      </li>",
"      <li>",
"       Report all clinically significant postvaccination reactions to the Vaccine Adverse Event Reporting System (VAERS). Reporting forms and instructions on filing a VAERS report are available at www.vaers.hhs.gov or by telephone, 800-822-7967.",
"       <br/>",
"       Information on how to file a Vaccine Injury Compensation Program claim is available at www.hrsa.gov/vaccinecompensation or by telephone, 800-338-2382. To file a claim for vaccine injury, contact the US Court of Federal Claims, 717 Madison Place, NW, Washington, DC 20005; telephone, 202-357-6400.",
"      </li>",
"     </ul>",
"     &Delta; Covered by the Vaccine Injury Compensation Program.",
"     <br/>",
"     <span class=\"lozenge\">",
"      &loz;",
"     </span>",
"     <strong>",
"      Influenza vaccination",
"     </strong>",
"     <br/>",
"     <ul>",
"      <li>",
"       Annual vaccination against influenza is recommended for all persons aged six months and older.",
"      </li>",
"      <li>",
"       Persons aged six months and older, including pregnant women, can receive the inactivated influenza vaccine (IIV).",
"      </li>",
"      <li>",
"       Healthy, nonpregnant persons aged 2 to 49 years without high-risk medical conditions can receive either intranasally administered live, attenuated influenza vaccine (LAIV) (FluMist), or IIV. Healthcare personnel who care for severely immunocompromised persons (ie, those who require care in a protected environment) should receive IIV rather than LAIV.",
"      </li>",
"      <li>",
"       The intramuscularly or intradermally administered IIV are options for adults aged 18 to 64 years.",
"      </li>",
"      <li>",
"       Adults aged 65 years and older can receive the standard dose IIV or the high-dose IIV (Fluzone High-Dose).",
"      </li>",
"     </ul>",
"     &sect;",
"     <strong>",
"      Tetanus, diphtheria, and acellular pertussis (Td/Tdap) vaccination",
"     </strong>",
"     <br/>",
"     <ul>",
"      <li>",
"       Administer one dose of Tdap vaccine to pregnant women during each pregnancy (preferred during 27 to 36 weeks' gestation), regardless of number of years since prior Td or Tdap vaccination.",
"      </li>",
"      <li>",
"       Administer Tdap to all other adults who have not previously received Tdap or for whom vaccine status is unknown. Tdap can be administered regardless of interval since the most recent tetanus or diphtheria-toxoid containing vaccine.",
"      </li>",
"      <li>",
"       Adults with an unknown or incomplete history of completing a three-dose primary vaccination series with Td-containing vaccines should begin or complete a primary vaccination series including a Tdap dose.",
"      </li>",
"      <li>",
"       For unvaccinated adults, administer the first 2 doses at least 4 weeks apart and the third dose 6 to 12 months after the second.",
"      </li>",
"      <li>",
"       For incompletely vaccinated (ie, less than three doses) adults, administer remaining doses.",
"      </li>",
"      <li>",
"       Refer to the Advisory Committee on Immunization Practices (ACIP) statement for recommendations for administering Td/Tdap as prophylaxis in wound management (see footnote*).",
"      </li>",
"     </ul>",
"     &yen;",
"     <strong>",
"      Varicella vaccination",
"     </strong>",
"     <br/>",
"     <ul>",
"      <li>",
"       All adults without evidence of immunity to varicella (as defined below) should receive two doses of single-antigen varicella vaccine or a second dose if they have received only one dose.",
"      </li>",
"      <li>",
"       Special consideration for vaccination should be given to those who have close contact with persons at high risk for severe disease (eg, healthcare personnel and family contacts of persons with immunocompromising conditions) or are at high risk for exposure or transmission (eg, teachers; child care employees; residents and staff members of institutional settings, including correctional institutions; college students; military personnel; adolescents and adults living in households with children; nonpregnant women of childbearing age; and international travelers).",
"      </li>",
"      <li>",
"       Pregnant women should be assessed for evidence of varicella immunity. Women who do not have evidence of immunity should receive the first dose of varicella vaccine upon completion or termination of pregnancy and before discharge from the health-care facility. The second dose should be administered four to eight weeks after the first dose.",
"      </li>",
"      <li>",
"       Evidence of immunity to varicella in adults includes any of the following:",
"       <br/>",
"       &mdash; Documentation of two doses of varicella vaccine at least four weeks apart;",
"       <br/>",
"       &mdash; US-born before 1980 except healthcare personnel and pregnant women;",
"       <br/>",
"       &mdash; History of varicella based on diagnosis or verification of varicella disease by a healthcare provider;",
"       <br/>",
"       &mdash; History of herpes zoster based on diagnosis or verification of herpes zoster disease by a healthcare provider; or",
"       <br/>",
"       &mdash; Laboratory evidence of immunity or laboratory confirmation of disease.",
"      </li>",
"     </ul>",
"     &Dagger;",
"     <strong>",
"      Human papillomavirus (HPV) vaccination",
"     </strong>",
"     <br/>",
"     <ul>",
"      <li>",
"       Two vaccines are licensed for use in females, bivalent HPV vaccine (HPV2) and quadrivalent HPV vaccine (HPV4), and one HPV vaccine for use in males (HPV4).",
"      </li>",
"      <li>",
"       For females, either HPV4 or HPV2 is recommended in a three-dose series for routine vaccination at age 11 or 12 years, and for those aged 13 through 26 years, if not previously vaccinated.",
"      </li>",
"      <li>",
"       For males, HPV4 is recommended in a three-dose series for routine vaccination at age 11 or 12 years, and for those aged 13 through 21 years, if not previously vaccinated. Males aged 22 through 26 years may be vaccinated.",
"      </li>",
"      <li>",
"       HPV4 is recommended for men who have sex with men (MSM) through age 26 years for those who did not get any or all doses when they were younger.",
"      </li>",
"      <li>",
"       Vaccination is recommended for immunocompromised persons (including those with HIV infection) through age 26 years for those who did not get any or all doses when they were younger.",
"      </li>",
"      <li>",
"       A complete series for either HPV4 or HPV2 consists of three doses. The second dose should be administered 1 to 2 months after the first dose; the third dose should be administered 6 months after the first dose (at least 24 weeks after the first dose).",
"      </li>",
"      <li>",
"       HPV vaccines are not recommended for use in pregnant women. However, pregnancy testing is not needed before vaccination. If a woman is found to be pregnant after initiating the vaccination series, no intervention is needed; the remainder of the three-dose series should be delayed until completion of pregnancy.",
"      </li>",
"      <li>",
"       Although HPV vaccination is not specifically recommended for healthcare personnel (HCP) based on their occupation, HCP should receive the HPV vaccine as recommended (see above).",
"      </li>",
"     </ul>",
"     &dagger;",
"     <strong>",
"      Zoster vaccination",
"     </strong>",
"     <br/>",
"     <ul>",
"      <li>",
"       A single dose of zoster vaccine is recommended for adults aged 60 years and older regardless of whether they report a prior episode of herpes zoster. Although the vaccine is licensed by the Food and Drug Administration (FDA) for use among and can be administered to persons aged 50 years and older, ACIP recommends that vaccination begins at age 60 years.",
"      </li>",
"      <li>",
"       Persons aged 60 years and older with chronic medical conditions may be vaccinated unless their condition constitutes a contraindication, such as pregnancy or severe immunodeficiency.",
"      </li>",
"      <li>",
"       Although zoster vaccination is not specifically recommended for HCP, they should receive the vaccine if they are in the recommended age group.",
"      </li>",
"     </ul>",
"     **",
"     <strong>",
"      Measles-mumps-rubella (MMR) vaccination",
"     </strong>",
"     <br/>",
"     <ul>",
"      <li>",
"       Adults born before 1957 generally are considered immune to measles and mumps. All adults born in 1957 or later should have documentation of one or more doses of MMR vaccine unless they have a medical contraindication to the vaccine, or laboratory evidence of immunity to each of the three diseases. Documentation of provider-diagnosed disease is not considered acceptable evidence of immunity for measles, mumps, or rubella.",
"      </li>",
"     </ul>",
"     <em>",
"      Measles component:",
"     </em>",
"     <br/>",
"     <ul>",
"      <li>",
"       A routine second dose of MMR vaccine, administered a minimum of 28 days after the first dose, is recommended for adults who",
"       <br/>",
"       &mdash; Are students in postsecondary educational institutions;",
"       <br/>",
"       &mdash; Work in a healthcare facility; or",
"       <br/>",
"       &mdash; Plan to travel internationally.",
"      </li>",
"      <li>",
"       Persons who received inactivated (killed) measles vaccine or measles vaccine of unknown type during 1963 to 1967 should be revaccinated with two doses of MMR vaccine.",
"      </li>",
"     </ul>",
"     <em>",
"      Mumps component:",
"     </em>",
"     <br/>",
"     <ul>",
"      <li>",
"       A routine second dose of MMR vaccine, administered a minimum of 28 days after the first dose, is recommended for adults who",
"       <br/>",
"       &mdash; Are students in a postsecondary educational institution;",
"       <br/>",
"       &mdash; Work in a healthcare facility; or",
"       <br/>",
"       &mdash; Plan to travel internationally.",
"      </li>",
"      <li>",
"       Persons vaccinated before 1979 with either killed mumps vaccine or mumps vaccine of unknown type who are at high risk for mumps infection (eg, persons who are working in a healthcare facility) should be considered for revaccination with two doses of MMR vaccine.",
"      </li>",
"     </ul>",
"     <em>",
"      Rubella component:",
"     </em>",
"     <br/>",
"     <ul>",
"      <li>",
"       For women of childbearing age, regardless of birth year, rubella immunity should be determined. If there is no evidence of immunity, women who are not pregnant should be vaccinated. Pregnant women who do not have evidence of immunity should receive MMR vaccine upon completion or termination of pregnancy and before discharge from the healthcare facility.",
"      </li>",
"     </ul>",
"     <em>",
"      HCP born before 1957:",
"     </em>",
"     <br/>",
"     <ul>",
"      <li>",
"       For unvaccinated health-care personnel born before 1957 who lack laboratory evidence of measles, mumps, and/or rubella immunity or laboratory confirmation of disease, healthcare facilities should consider vaccinating personnel with two doses of MMR vaccine at the appropriate interval for measles and mumps or one dose of MMR vaccine for rubella.",
"      </li>",
"     </ul>",
"     &Delta;&Delta;",
"     <strong>",
"      Pneumococcal polysaccharide (PPSV23) vaccination",
"     </strong>",
"     <br/>",
"     <ul>",
"      <li>",
"       Vaccinate all persons with the following indications:",
"       <br/>",
"       &mdash; All adults aged 65 years and older;",
"       <br/>",
"       &mdash; Adults younger than age 65 years with chronic lung disease (including chronic obstructive pulmonary disease, emphysema, and asthma); chronic cardiovascular diseases; diabetes mellitus; chronic renal failure; nephrotic syndrome; chronic liver disease (including cirrhosis); alcoholism; cochlear implants; cerebrospinal fluid leaks; immunocompromising conditions; and functional or anatomic asplenia (eg, sickle cell disease and other hemoglobinopathies, congenital or acquired asplenia, splenic dysfunction, or splenectomy [if elective splenectomy is planned, vaccinate at least two weeks before surgery]);",
"       <br/>",
"       &mdash; Residents of nursing homes or long-term care facilities; and",
"       <br/>",
"       &mdash; Adults who smoke cigarettes.",
"      </li>",
"      <li>",
"       Persons with immunocompromising conditions and other selected conditions are recommended to receive PCV13 and PPSV23 vaccines. See footnote &sect;&sect; for information on timing of PCV13 and PPSV23 vaccinations.",
"      </li>",
"      <li>",
"       Persons with asymptomatic or symptomatic HIV infection should be vaccinated as soon as possible after their diagnosis.",
"      </li>",
"      <li>",
"       When cancer chemotherapy or other immunosuppressive therapy is being considered, the interval between vaccination and initiation of immunosuppressive therapy should be at least two weeks. Vaccination during chemotherapy or radiation therapy should be avoided.",
"      </li>",
"      <li>",
"       Routine use of PPSV23 is not recommended for American Indians/Alaska Natives or other persons younger than age 65 years unless they have underlying medical conditions that are PPSV23 indications. However, public health authorities may consider recommending PPSV23 for American Indians/Alaska Natives who are living in areas where the risk for invasive pneumococcal disease is increased.",
"      </li>",
"      <li>",
"       When indicated, PPSV23 should be administered to patients who are uncertain of their vaccination status and there is no record of previous vaccination. When PCV13 is also indicated, a dose of PCV13 should be given first (see footnote &sect;&sect;).",
"      </li>",
"     </ul>",
"     <span class=\"double_lozenge\">",
"      &loz;&loz;",
"     </span>",
"     <strong>",
"      Revaccination with PPSV23",
"     </strong>",
"     <br/>",
"     <ul>",
"      <li>",
"       One-time revaccination 5 years after the first dose is recommended for persons aged 19 through 64 years with chronic renal failure or nephrotic syndrome; functional or anatomic asplenia (eg, sickle cell disease or splenectomy); and for persons with immunocompromising conditions.",
"      </li>",
"      <li>",
"       Persons who received 1 or 2 doses of PPSV23 before age 65 years for any indication should receive another dose of the vaccine at age 65 years or later if at least 5 years have passed since their previous dose.",
"      </li>",
"      <li>",
"       No further doses are needed for persons vaccinated with PPSV23 at or after age 65 years.",
"      </li>",
"     </ul>",
"     &sect;&sect;",
"     <strong>",
"      Pneumococcal conjugate 13-valent vaccination (PCV13)",
"     </strong>",
"     <br/>",
"     <ul>",
"      <li>",
"       Adults aged 19 years or older with immunocompromising conditions (including chronic renal failure and nephrotic syndrome), functional or anatomic asplenia, CSF leaks or cochlear implants, and who have not previously received PCV13 or PPSV23 should receive a single dose of PCV13 followed by a dose of PPSV23 at least 8 weeks later.",
"      </li>",
"      <li>",
"       Adults aged 19 years or older with the aforementioned conditions who have previously received one or more doses of PPSV23 should receive a dose of PCV13 one or more years after the last PPSV23 dose was received. For those that require additional doses of PPSV23, the first such dose should be given no sooner than 8 weeks after PCV13 and at least 5 years since the most recent dose of PPSV23.",
"      </li>",
"      <li>",
"       When indicated, PCV13 should be administered to patients who are uncertain of their vaccination status history and there is no record of previous vaccination.",
"      </li>",
"      <li>",
"       Although PCV13 is licensed by the FDA for use among and can be administered to persons aged 50 years and older, ACIP recommends PCV13 for adults aged 19 years and older with the specific medical conditions noted above.",
"      </li>",
"     </ul>",
"     &yen;&yen;",
"     <strong>",
"      Meningococcal vaccination",
"     </strong>",
"     <br/>",
"     <ul>",
"      <li>",
"       Administer two doses of meningococcal conjugate vaccine quadrivalent (MCV4) at least two months apart to adults with functional asplenia or persistent complement component deficiencies.",
"      </li>",
"      <li>",
"       HIV-infected persons who are vaccinated also should receive two doses.",
"      </li>",
"      <li>",
"       Administer a single dose of meningococcal vaccine to microbiologists routinely exposed to isolates of Neisseria meningitidis, military recruits, and persons who travel to or live in countries in which meningococcal disease is hyperendemic or epidemic.",
"      </li>",
"      <li>",
"       First-year college students up through age 21 years who are living in residence halls should be vaccinated if they have not received a dose on or after their 16th birthday.",
"      </li>",
"      <li>",
"       MCV4 is preferred for adults with any of the preceding indications who are aged 55 years and younger; meningococcal polysaccharide vaccine (MPSV4) is preferred for adults aged 56 years and older.",
"      </li>",
"      <li>",
"       Revaccination with MCV4 every five years is recommended for adults previously vaccinated with MCV4 or MPSV4 who remain at increased risk for infection (eg, adults with anatomic or functional asplenia or persistent complement component deficiencies).",
"      </li>",
"     </ul>",
"     &Dagger;&Dagger;",
"     <strong>",
"      Hepatitis A vaccination",
"     </strong>",
"     <br/>",
"     <ul>",
"      <li>",
"       Vaccinate any person seeking protection from hepatitis A virus (HAV) infection and persons with any of the following indications:",
"       <br/>",
"       &mdash; Men who have sex with men and persons who use injection or noninjection illicit drugs;",
"       <br/>",
"       &mdash; Persons working with HAV-infected primates or with HAV in a research laboratory setting;",
"       <br/>",
"       &mdash; Persons with chronic liver disease and persons who receive clotting factor concentrates;",
"       <br/>",
"       &mdash; Persons traveling to or working in countries that have high or intermediate endemicity of hepatitis A; and",
"       <br/>",
"       &mdash; Unvaccinated persons who anticipate close personal contact (eg, household or regular babysitting) with an international adoptee during the first 60 days after arrival in the United States from a country with high or intermediate endemicity. (See footnote * for more information on travel recommendations). The first dose of the two-dose hepatitis A vaccine series should be administered as soon as adoption is planned, ideally two or more weeks before the arrival of the adoptee.",
"      </li>",
"      <li>",
"       Single-antigen vaccine formulations should be administered in a two-dose schedule at either 0 and 6 to 12 months (Havrix), or 0 and 6 to 18 months (Vaqta). If the combined hepatitis A and hepatitis B vaccine (Twinrix) is used, administer t3 doses at 0, 1, and 6 months; alternatively, a four-dose schedule may be used, administered on days 0, 7, and 21 to 30, followed by a booster dose at month 12.",
"      </li>",
"     </ul>",
"     &dagger;&dagger;",
"     <strong>",
"      Hepatitis B vaccination",
"     </strong>",
"     <br/>",
"     <ul>",
"      <li>",
"       Vaccinate persons with any of the following indications and any person seeking protection from hepatitis B virus (HBV) infection:",
"       <br/>",
"       &mdash; Sexually active persons who are not in a long-term, mutually monogamous relationship (eg, persons with more than one sex partner during the previous six months); persons seeking evaluation or treatment for a sexually transmitted disease (STD); current or recent injection-drug users; and men who have sex with men;",
"       <br/>",
"       &mdash; Healthcare personnel and public safety workers who are potentially exposed to blood or other infectious body fluids;",
"       <br/>",
"       &mdash; Persons with diabetes younger than age 60 years as soon as feasible after diagnosis; persons with diabetes who are age 60 years or older at the discretion of the treating clinician based on increased need for assisted blood glucose monitoring in long-term care facilities, likelihood of acquiring hepatitis B infection, its complications or chronic sequelae, and likelihood of immune response to vaccination;",
"       <br/>",
"       &mdash; Persons with end-stage renal disease, including patients receiving hemodialysis; persons with HIV infection; and persons with chronic liver disease;",
"       <br/>",
"       &mdash; Household contacts and sex partners of hepatitis B surface antigenpositive persons; clients and staff members of institutions for persons with developmental disabilities; and international travelers to countries with high or intermediate prevalence of chronic HBV infection; and",
"       <br/>",
"       &mdash; All adults in the following settings: STD treatment facilities; HIV testing and treatment facilities; facilities providing drug-abuse treatment and prevention services; healthcare settings targeting services to injection-drug users or men who have sex with men; correctional facilities; end-stage renal disease programs and facilities for chronic hemodialysis patients; and institutions and nonresidential daycare facilities for persons with developmental disabilities.",
"      </li>",
"      <li>",
"       Administer missing doses to complete a three-dose series of hepatitis B vaccine to those persons not vaccinated or not completely vaccinated. The second dose should be administered one month after the first dose; the third dose should be given at least two months after the second dose (and at least four months after the first dose). If the combined hepatitis A and hepatitis B vaccine (Twinrix) is used, give 3 doses at 0, 1, and 6 months; alternatively, a four-dose Twinrix schedule, administered on days 0, 7, and 21 to 30 followed by a booster dose at month 12 may be used.",
"      </li>",
"      <li>",
"       Adult patients receiving hemodialysis or with other immunocompromising conditions should receive 1 dose of 40 mcg/mL (Recombivax HB) administered on a three-dose schedule at 0, 1, and 6 months or 2 doses of 20 mcg/mL (Engerix-B) administered simultaneously on a four-dose schedule at 0, 1, 2, and 6 months.",
"      </li>",
"     </ul>",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Bridges CB, Woods L, Coyne-Beasley T, Immunization Services Division, National Center for Immunization and Respiratory Diseases, CDC. Advisory Committee on Immunization Practices (ACIP) Recommended Immunization Schedule for Adults Aged 19 Years and Older - United States, 2013. MMWR Surveill Summ 2013; 62:9.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
